CREATE TABLE `zipcodes` (
  `ImportID` int(11) NOT NULL AUTO_INCREMENT,
  `DateCreated` datetime DEFAULT NULL,
  `DateUpdated` datetime DEFAULT NULL,
  `zip_code` varchar(5) DEFAULT NULL,
  `state_abbreviation` varchar(2) DEFAULT NULL,
  `latitude` varchar(9) DEFAULT NULL,
  `longitude` varchar(10) DEFAULT NULL,
  `city` varchar(27) DEFAULT NULL,
  `state` varchar(20) DEFAULT NULL,
  `gm_search` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`ImportID`),
  KEY `zip_code` (`zip_code`),
  KEY `state_abrev` (`state_abbreviation`),
  KEY `State` (`state`),
  KEY `city` (`city`)
) ENGINE=MyISAM AUTO_INCREMENT=33179 DEFAULT CHARSET=latin1


